import{_ as t,r,o as c,c as d,a as e,b as h,w as i,d as a,e as n}from"./app.efeddd24.js";const p={},l=e("h1",{id:"unix-\u54F2\u5B66\u539F\u5219",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#unix-\u54F2\u5B66\u539F\u5219","aria-hidden":"true"},"#"),a(" Unix_\u54F2\u5B66\u539F\u5219")],-1),u=a("Unix \u54F2\u5B66\u539F\u5219"),s=n('<h2 id="\u6A21\u5757\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u6A21\u5757\u539F\u5219" aria-hidden="true">#</a> \u6A21\u5757\u539F\u5219</h2><blockquote><p>\u8BA1\u7B97\u673A\u7F16\u7A0B\u7684\u672C\u8D28\u5C31\u662F\u63A7\u5236\u590D\u6742\u5EA6.</p></blockquote><p>\u590D\u6742\u5EA6\u4E0D\u662F\u673A\u5668\u7684\u77ED\u5904, \u800C\u662F\u4EBA\u7684\u77ED\u5904. \u8FC7\u5206\u590D\u6742\u4F1A\u5927\u5927\u63D0\u5347\u51FA\u9519\u7684\u6982\u7387\u548C\u6392\u9519\u7684\u96BE\u5EA6. \u56E0\u6B64, \u6A21\u5757\u5316\u4E3B\u8981\u7684\u76EE\u7684\u5730\u4E8E\u5C06\u4E00\u4EF6\u590D\u6742\u7684\u5927\u4E8B, \u53D8\u6210\u8BB8\u591A\u7B80\u5355\u7684\u5C0F\u4E8B.</p><h2 id="\u7EC4\u5408\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u7EC4\u5408\u539F\u5219" aria-hidden="true">#</a> \u7EC4\u5408\u539F\u5219</h2><blockquote><p>\u5728\u7ECF\u5178\u7684 Unix \u4E0B, \u591A\u6570\u7A0B\u5E8F\u5C3D\u53EF\u80FD\u91C7\u7528\u7B80\u5355\u8FC7\u6EE4\u5668\u7684\u5F62\u5F0F, \u5373\u5C06\u4E00\u4E2A\u8F93\u5165\u7684\u7B80\u5355\u6587\u672C\u6D41\u5904\u7406\u4E3A\u4E00\u4E2A\u7B80\u5355\u7684\u6587\u672C\u6D41\u8F93\u51FA ... ... \u56E0\u4E3A\u5982\u679C\u7A0B\u5E8F\u4E0D\u91C7\u7528\u7B80\u5355\u7684\u6587\u672C\u8F93\u5165\u8F93\u51FA, \u5B83\u4EEC\u5C31\u6781\u96BE\u8854\u63A5.</p></blockquote><p>\u6240\u4EE5\u6B63\u5219\u8868\u8FBE\u5F0F, sed, awk \u624D\u5982\u6B64\u91CD\u8981. \u800C\u6240\u4EE5\u4E60\u60EF\u4F7F\u7528 windows \u7684\u4E2D\u56FD, \u6B63\u5219\u8868\u8FBE\u5F0F\u6CA1\u6709\u88AB\u5F88\u597D\u7684\u63A8\u5E7F.</p><blockquote><p>\u5F53\u7A0B\u5E8F\u65E0\u6CD5\u81EA\u7136\u5730\u4F7F\u7528\u5E8F\u5217\u5316, \u534F\u8BAE\u5F62\u5F0F\u7684\u63A5\u53E3\u65F6, \u6B63\u786E\u7684 Unix \u8BBE\u8BA1\u81F3\u5C11\u662F, \u628A\u5C3D\u53EF\u80FD\u591A\u7684\u7F16\u7A0B\u65E0\u7D20\u7EC4\u7EC7\u6210\u4E00\u5957\u5B9A\u4E49\u826F\u597D\u7684 API.</p></blockquote><p>\u5B9A\u4E49 API \u662F\u5728\u5B9A\u4E49\u7F16\u7A0B\u65E0\u7D20\u7684\u7EC4\u7EC7\u5F62\u5F0F.</p><h2 id="\u5206\u79BB\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u5206\u79BB\u539F\u5219" aria-hidden="true">#</a> \u5206\u79BB\u539F\u5219</h2><blockquote><p>\u628A\u7B56\u7565\u540C\u673A\u5236\u63C9\u6210\u4E00\u56E2\u6709\u4E24\u4E2A\u8D1F\u9762\u7684\u5F71\u54CD: \u4E00\u6765\u4F1A\u4F7F\u7B56\u7565\u53D8\u5F97\u6B7B\u677F, \u96BE\u4EE5\u9002\u5E94\u7528\u6237\u9700\u6C42\u7684\u6539\u53D8, \u4E8C\u6765\u4E5F\u610F\u5473\u9612\u4EFB\u4F55\u7B56\u7565\u7684\u6539\u53D8\u90FD\u6781\u6709\u53EF\u80FD\u52A8\u63FA\u673A\u5236.</p></blockquote><p>\u9996\u5148, \u6211\u4EEC\u8981\u533A\u5206\u51FA\u4EC0\u4E48\u662F\u673A\u5236, \u4EC0\u4E48\u662F\u7B56\u7565</p><h2 id="\u7B80\u6D01\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u7B80\u6D01\u539F\u5219" aria-hidden="true">#</a> \u7B80\u6D01\u539F\u5219</h2><blockquote><p>\u8FC7\u5EA6\u7684\u590D\u6742\u5EA6\u5F80\u5F80\u6765\u81EA\u4E8E\u9879\u76EE\u7684\u8981\u6C42, \u800C\u8FD9\u4E00\u8981\u6C42\u5E38\u5E38\u57FA\u4E8E\u5F53\u6708\u7684\u63A8\u9500\u70ED\u70B9, \u800C\u4E0D\u662F\u57FA\u4E8E\u987E\u5BA2\u7684\u9700\u6C42\u548C\u8F6F\u4EF6\u5B9E\u9645\u80FD\u591F\u63D0\u4F9B\u7684\u529F\u80FD.</p></blockquote><p>\u89C4\u6A21\u5384\u6740\u8D28\u91CF\u7684\u53C8\u4E00\u4F8B.</p><h2 id="\u900F\u660E\u6027\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u900F\u660E\u6027\u539F\u5219" aria-hidden="true">#</a> \u900F\u660E\u6027\u539F\u5219</h2><blockquote><p>\u8F6F\u4EF6\u7CFB\u7EDF\u7684\u900F\u660E\u6027\u662F\u6307\u4F60\u4E00\u773C\u5C31\u80FD\u591F\u770B\u51FA\u8F6F\u4EF6\u662F\u5728\u505A\u4EC0\u4E48\u4EE5\u53CA\u600E\u6837\u505A\u7684.</p></blockquote><p>\u4E00\u5207\u4F18\u96C5\u7684\u4EE3\u7801\u90FD\u5E94\u8BE5\u662F\u900F\u660E\u7684.</p><blockquote><p>\u7A0B\u5E8F\u4E0D\u4F46\u5E94\u8BE5\u80FD\u591F\u5C55\u793A\u5176\u6B63\u786E\u6027, \u4E5F\u5E94\u8BE5\u80FD\u591F\u628A\u539F\u5F00\u53D1\u8005\u89E3\u51B3\u95EE\u9898\u7684\u601D\u7EF4\u6A21\u578B\u544A\u8BC9\u8BFB\u8005.</p></blockquote><p>\u4EE3\u7801\u80CC\u540E\u662F\u601D\u60F3, \u5982\u679C\u4E0D\u80FD\u6E05\u6670\u7684\u53CD\u5E94\u5F00\u53D1\u8005\u7684\u601D\u60F3, \u591A\u591A\u5C11\u5C11\u4E5F\u8BF4\u660E\u5F00\u53D1\u8005\u7684\u601D\u60F3\u672C\u8EAB\u4E0D\u591F\u6E05\u6670.</p><h2 id="\u8868\u793A\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u8868\u793A\u539F\u5219" aria-hidden="true">#</a> \u8868\u793A\u539F\u5219</h2><blockquote><p>\u5373\u4F7F\u6700\u7B80\u5355\u7684\u7A0B\u5E8F\u903B\u8F91\u8BA9\u4EBA\u7C7B\u6765\u9A8C\u8BC1\u4E5F\u5F88\u56F0\u96BE, \u4F46\u662F\u5C31\u7B97\u662F\u5F88\u590D\u6742\u7684\u6570\u636E, \u5BF9\u4EBA\u7C7B\u6765\u8BF4, \u8FD8\u662F\u76F8\u5BF9\u5BB9\u6613\u5730\u5C31\u80FD\u591F\u63A8\u5BFC\u548C\u5EFA\u6A21\u7684.</p></blockquote><p>\u8FD9\u5C31\u662F\u4E3A\u4EC0\u4E48\u9762\u5411\u5BF9\u8C61, \u8FD9\u4E5F\u662F\u4E3A\u4EC0\u4E48\u8981\u8FDB\u884C\u5EFA\u6A21. \u62BD\u8C61\u662F\u7406\u6027\u4E4B\u6E90.</p><h2 id="\u901A\u4FD7\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u901A\u4FD7\u539F\u5219" aria-hidden="true">#</a> \u901A\u4FD7\u539F\u5219</h2><blockquote><p>\u5173\u6CE8\u53D7\u4F17 ... ... \u5173\u6CE8\u4F20\u7EDF\u60EF\u4F8B.</p></blockquote><p>\u826F\u597D\u7684\u8FED\u4EE3, \u53CD\u800C\u9700\u8981\u4F20\u7EDF\u60EF\u4F8B\u7684\u652F\u6491.</p><h2 id="\u8865\u6551\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u8865\u6551\u539F\u5219" aria-hidden="true">#</a> \u8865\u6551\u539F\u5219</h2><blockquote><p>&quot;\u5BBD\u5BB9\u5730\u6539, \u8C28\u614E\u7684\u53D1&quot;</p></blockquote><p>\u5728\u4E00\u822C\u7684\u7BA1\u7406\u539F\u5219\u4E2D, \u4E5F\u8981\u6C42\u8C28\u614E\u4EA4\u4ED8. \u7CFB\u7EDF\u534F\u4F5C\u5FC5\u987B\u8981\u6C42\u5411\u4E0B\u6E38\u8D1F\u8D23.</p><h2 id="\u4F18\u5316\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u4F18\u5316\u539F\u5219" aria-hidden="true">#</a> \u4F18\u5316\u539F\u5219</h2><blockquote><p>\u5148\u5236\u4F5C\u539F\u578B, \u518D\u7CBE\u96D5\u7EC6\u7422. \u4F18\u5316\u4E4B\u524D\u5148\u786E\u4FDD\u80FD\u7528. \u6216\u8005\u8BF4, \u5148\u80FD\u8D70, \u518D\u5B66\u8DD1 ... ... \u5148\u80FD\u8FD0\u884C, \u518D\u6C42\u6B63\u786E, \u6700\u540E\u6C42\u5FEB.</p></blockquote><p>\u6B63\u662F\u5728\u8FD9\u6837\u4E00\u4E2A\u601D\u8DEF\u4E0B, linux \u624D\u5728\u5F00\u6E90\u793E\u533A\u4E2D\u88AB\u96C6\u4F53\u5F00\u53D1\u51FA\u6765.</p><p>\u4E5F\u7531\u6B64\u53EF\u89C1, \u654F\u6377\u65B9\u6CD5\u548C unix \u54F2\u5B66\u7684\u4E00\u8109\u76F8\u627F.</p><blockquote><p>\u76EE\u524D, \u6700\u5F3A\u5927\u7684\u4F18\u5316\u5DE5\u5177\u6050\u6015\u5C31\u662F delete \u952E\u4E86.</p></blockquote><p>\u7985?</p>',34);function b(k,_){const o=r("RouterLink");return c(),d("div",null,[l,e("p",null,[h(o,{to:"/"},{default:i(()=>[u]),_:1})]),s])}var x=t(p,[["render",b],["__file","Unix_\u54F2\u5B66\u539F\u5219.html.vue"]]);export{x as default};
